import './App.css';

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function Home(){
  return<div>Home</div>;
}

function About(){
  return<div>About</div>;
}
function App() {
  return (
    <Router>
      <div class="App.js">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
      </div>
    </Router>
  );
}

export default App;
